import React from 'react';

const WorkshopDetails = (workshop) => {

        return (
            <div>
                <table>
                <thead>
                    <th>First Name</th>
                    <th>Last Name</th>
                </thead>
                <tbody>
                        <tr key={workshop.id}>
                        <p>{workshop.title}</p>
                            <p>{workshop.status_open}</p>
                            <p>{workshop.date}</p>
                            <p>{workshop.description}</p>
                            <p>{workshop.room_id}</p>
                        </tr>
                </tbody>
                </table>

            </div>
        );
}

export default WorkshopDetails;
